import React from 'react';
import s from './Counter.module.css'

type CointerType = {
started:()=>void;
}

export const 小ounter = (props:CointerType) => {

    const onclickHandler = ()=> {
        props.started()
    }

    return (
        <div className={s.fon}>
           <span>
               <button>0</button></span>
            <div>
                <button onClick={onclickHandler}>inc</button>
                <button>reset</button>
            </div>

        </div>
    );
};
